/* @flow */
import * as React from 'react'
import Icon from '../../atoms/Icon';
import Button from '../../atoms/button';

import styles from './style.css'



type Props = {
  children?: React.Node,
  className?: string,
  position?: string,
}

const Block = (props: Props): React.Element<*> => {
  return (
    <div class={props.className}>
        <Icon />
        <Button />
    </div>
  );
};

Block.defaultProps = {
  className: '',
  children: '',
  position: '',
}

export default Block
